    #tabstrip {
        bottom: 0px;
        position: fixed;
        border-top: 1px solid #ccc;
        width: 100%;
        overflow-x: auto;
        white-space: nowrap;
    }
    #tabstrip div { /* Contains the tabstrip links */
        border-right: 1px solid #ccc;
        padding: 3px 5px;
        display: inline-block;
    }
    #tabstrip a {
        text-decoration: none;
        font-size: 14px;
        font-family: "Open Sans","lucida grande","Segoe UI",arial,verdana,"lucida sans unicode",tahoma,sans-serif;
        /* Before a sheet is loaded, its tab is inactive */
        cursor: default;
        color: #ccc;
    }
    #tabstrip a.loaded {
        cursor: auto;
        color: #2895f1;
    }
    /* This should appear after the "loaded" style for precedence */
    #tabstrip a.current {
        cursor: default;
        color: #000;
    }
    #wrapper {
        overflow: auto;
        width: 100%;
        left: 0px;
        top: 0px;
        position: relative;
    }

</style><script type="text/javascript">
    (function(globals) {
        globals.loaded_sheets = {};
    }(this));

    function _show_sheet(sheet_id) {
        var sheets = document.getElementsByClassName("sheet-content");
        for (var i = 0; i < sheets.length; i++) {
            sheets[i].style.display = sheet_id == sheets[i].id ? "inline-block" : "none";
        }
        var tab_links = document.getElementsByClassName("tabstrip-link");
        for (var i = 0; i < tab_links.length; i++) {
            // Remove the "current" class from all tabs and add it to the one that was clicked.
            tab_links[i].className = tab_links[i].className.replace(/\bcurrent\b/, "");
            if (tab_links[i].getAttribute('sheet_id') == sheet_id) {
                tab_links[i].className += " current";
            }
        }
    }

    function on_tab_click(sheet_id) {
        if (sheet_id in loaded_sheets) {
            _show_sheet(sheet_id);
            document.getElementById('wrapper').scrollTop = 0;
        }
    }

    function activate_tab(tabstrip_link_id) {
        var link = document.getElementById(tabstrip_link_id);
        link.className += " loaded";
        var sheet_id = link.getAttribute('sheet_id');
        loaded_sheets[sheet_id] = true;
    }

    function goto_cell(sheet_id, ele_name) {
        if (sheet_id in loaded_sheets) {
            _show_sheet(sheet_id);
            document.getElementsByName(ele_name)[0].scrollIntoView();
        }
    }

    function resize() {
        var w_height = window.innerHeight;
        var t_height = document.getElementById('tabstrip').offsetHeight;
        document.getElementById('wrapper').style.height = (w_height - t_height) + "px";
    }

    window.onresize = resize;
